import React, { Component } from "react";
import {
  View,
  Text,
  SafeAreaView,
  TextInput,
  Platform,
  StatusBar,
  ScrollView,
  Image,
  Dimensions,
} from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import Icon from "react-native-vector-icons/Ionicons";
import Home from "./home";
const { height, width } = Dimensions.get("window");
var screenHeight = Math.round(Dimensions.get("window").height) / 100;
var specifics;
export default class cat extends Component {
  state = {
    skill: "coding",
    specifics: [],
  };
  componentDidMount() {
    if (this.state.skill == "coding")
      specifics = [
        "FrontEnd Development",
        "BackEnd Development",
        "Mobile Development",
        "Web Development",
        "Interview Prep",
        "Java",
        "JavaScript",
        "Python",
      ];
    this.setState({ specifics });
  }
  display = () => {
    return this.state.specifics.map((value) => (
      <Home
        width={width}
        name={value}
        type="PRIVATE ROOM - 2 BEDS"
        price={82}
        rating={4}
      />
    ));
  };
  render() {
    return (
      <LinearGradient
        colors={["#09C6F9", "#045DE9"]}
        start={{ x: 1, y: 0 }}
        end={{ x: 0, y: 1 }}
        style={{ height: screenHeight * 100 }}
      >
        <SafeAreaView style={{ flex: 1 }}>
          <View style={{ flex: 1 }}>
            <View
              style={{
                height: this.startHeaderHeight,
                borderBottomWidth: 1,
                borderBottomColor: "#dddddd",
              }}
            >
              <View
                style={{
                  flexDirection: "row",
                  padding: 10,
                  marginHorizontal: 20,
                  shadowOffset: { width: 0, height: 0 },
                  shadowColor: "black",
                  shadowOpacity: 0.2,
                  elevation: 1,
                  marginTop: Platform.OS == "android" ? 30 : null,
                }}
              >
                <Icon name="ios-search" size={20} style={{ marginRight: 10 }} />
                <TextInput
                  underlineColorAndroid="transparent"
                  placeholder="Try New Delhi"
                  placeholderTextColor="grey"
                  style={{
                    flex: 1,
                    fontWeight: "700",
                    backgroundColor: "white",
                  }}
                />
              </View>
            </View>
            <ScrollView scrollEventThrottle={16}>
              <View style={{ marginTop: 40 }}>
                <Text
                  style={{
                    fontSize: 24,
                    fontWeight: "700",
                    paddingHorizontal: 20,
                    color: "white",
                  }}
                >
                  Coding
                </Text>
                <View
                  // horizontal={true}
                  style={{
                    flexWrap: "wrap",
                    justifyContent: "space-between",
                    flexDirection: "row",
                    marginTop: 20,
                  }}
                >
                  {this.display()}
                </View>
              </View>
            </ScrollView>
          </View>
        </SafeAreaView>
      </LinearGradient>
    );
  }
}
